_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"905088","type":"CustomJS"},{"attributes":{"data":{},"selected":{"id":"904861"},"selection_policy":{"id":"904860"}},"id":"904839","type":"ColumnDataSource"},{"attributes":{"toolbar":{"id":"905174"}},"id":"905175","type":"ToolbarBox"},{"attributes":{"label":{"value":"Peak (102%)"},"renderers":[{"id":"904798"}]},"id":"904815","type":"LegendItem"},{"attributes":{},"id":"905020","type":"BasicTickFormatter"},{"attributes":{"coordinates":null,"formatter":{"id":"904805"},"group":null,"major_label_policy":{"id":"904806"},"ticker":{"id":"904754"},"visible":false},"id":"904753","type":"LinearAxis"},{"attributes":{},"id":"904948","type":"LinearScale"},{"attributes":{},"id":"905035","type":"DataRange1d"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D96taupjxzwPxWodJliAvA/OdzGW/k48D84khvrQTXwPxOsKBdHIvA/BzAJcKog8D+3Hd2yikHwP5V8f0kCCvA
